import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

function ViewTravels() {
  const [travels, setTravels] = useState([]);
  const [comments, setComments] = useState([]);
  const [searchQuery, setSearchQuery] = useState("");
  const navigate = useNavigate();

  // Cargar datos iniciales
  useEffect(() => {
    const fetchData = async () => {
      try {
        const travelResponse = await axios.get("http://localhost:3001/api/travels");
        const commentResponse = await axios.get("http://localhost:3001/api/comments");
        setTravels(travelResponse.data);
        setComments(commentResponse.data);
      } catch (error) {
        console.error("Error al obtener datos:", error);
      }
    };
    fetchData();
  }, []);

  // Filtrar viajes por país
  const filteredTravels = searchQuery
    ? travels.filter((travel) =>
        travel.country.toLowerCase().includes(searchQuery.toLowerCase())
      )
    : travels;

  // Manejo de eliminación
  const handleDeleteTravel = async (id) => {
    try {
      await axios.delete(`http://localhost:3001/api/travels/${id}`);
      setTravels(travels.filter((travel) => travel.id !== id));
    } catch (error) {
      console.error("Error al eliminar el viaje:", error);
    }
  };

  const handleDeleteComment = async (id) => {
    try {
      await axios.delete(`http://localhost:3001/api/comments/${id}`);
      setComments(comments.filter((comment) => comment._id !== id));
    } catch (error) {
      console.error("Error al eliminar el comentario:", error);
    }
  };

  return (
    <div style={{ padding: "2rem" }}>
      <h2>Consultar Viajes</h2>

      {/* Sección superior: búsqueda y tabla de viajes */}
      <div>
        <input
          type="text"
          placeholder="Buscar por país"
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
        <table>
          <thead>
            <tr>
              <th>País</th>
              <th>Duración</th>
              <th>Costos</th>
              <th>Kilómetros</th>
              <th>Mes</th>
              <th>Año</th>
              <th>Acciones</th>
            </tr>
          </thead>
          <tbody>
            {filteredTravels.map((travel) => (
              <tr key={travel.id}>
                <td>{travel.country}</td>
                <td>{travel.duration}</td>
                <td>{travel.cost}</td>
                <td>{travel.distance}</td>
                <td>{travel.month}</td>
                <td>{travel.year}</td>
                <td>
                  <button onClick={() => navigate(`/edit-travel/${travel.id}`)}>
                    Editar
                  </button>
                  <button onClick={() => handleDeleteTravel(travel.id)}>
                    Eliminar
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Sección inferior: comentarios */}
      <div style={{ marginTop: "2rem" }}>
        <h3>Comentarios</h3>
        <div style={{ display: "grid", gridTemplateColumns: "repeat(auto-fill, minmax(200px, 1fr))", gap: "1rem" }}>
          {comments.map((comment) => (
            <div key={comment._id} style={{ border: "1px solid #ccc", padding: "1rem" }}>
              <p><strong>País:</strong> {comment.country}</p>
              <p><strong>Comentario:</strong> {comment.comment}</p>
              <button onClick={() => navigate(`/edit-comment/${comment._id}`)}>
                Editar
              </button>
              <button onClick={() => handleDeleteComment(comment._id)}>
                Eliminar
              </button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default ViewTravels;
